import { api } from "./api";

export async function getGestors() {
    const accessToken = sessionStorage.getItem('token');
    const result = await api.get('/gestors', {
        headers: {
            'Authorization': `Bearer ${JSON.parse(accessToken)}`
        }
    });
    return result;
}

export async function deleteGestor(id) {
    const accessToken = sessionStorage.getItem('token');
    const result = await api.delete(`/gestor/${id}`, {
        headers: {
            'Authorization': `Bearer ${JSON.parse(accessToken)}`
        }
    });
    return result;
}

export async function updateGestor(data) {
    const accessToken = sessionStorage.getItem('token');
    const result = await api.put(`/gestor/${data.id}`, {
        nome: data.unity,
        sobrenome: data.unity,
        genero: data.unity,
        dataDeNascimento: data.unity,
        idade: data.unity,
        localDeTrabalho: data.unity,
        CRM: data.unity,
        tipoDeContrato: data.unity,
        formacao: data.unity,
        senhaProvisoria: data.unity

    }, {
        headers: {
            'Authorization': `Bearer ${JSON.parse(accessToken)}`
        }
    });
    return result;
}

export async function createGestor(data) {
    const accessToken = sessionStorage.getItem('token');
    const result = await api.post('/gestor', {
        nome: data.unity,
        sobrenome: data.unity,
        genero:  data.unity,
        dataDeNascimento: data.unity,
        idade: data.unity,
        localDeTrabalho: data.unity,
        CRM: data.unity,
        tipoDeContrato: data.unity,
        formacao: data.unity,
        senhaProvisoria: data.unity
    }, {
        headers: {
            'Authorization': `Bearer ${JSON.parse(accessToken)}`
        }
    });
    return result;
}
